export default function Produto(props) {
    return (
        <Container fluid>
            <Card className={props.categoria + " col-lg-3 col-md-4 col-sm-6 col-xs-12 mr-auto"}>
                <Card.Img src="#" variant="top" alt ="Imagem do produto" />
                <Card.Body>
                    <Card.Title className="nome-produto">{props.nome}</Card.Title>
                    <Card.Text ClassName="preco-antigo">{props.preco}</Card.Text>
                    <Card.Text ClassName="preco-novo">{props.precoVenda}</Card.Text>
                    <Button variant="success" type="button" href="#" className = "">Saber mais</Button>
                </Card.Body>
            </Card>
        </Container>
    )
}
